import React from "react";

const DownloadBUtton = () => {
  const runDownload = e => {
    e.preventDefault();
    console.log("hi");
  };
  return (
    <a href="" onClick={runDownload}>
      Download
    </a>
  );
};

export default DownloadBUtton;
